        Vector<Integer> vector = new Vector<>();

        // Adding initial elements
        vector.add(10);
        vector.add(20);
        vector.add(30);

        /* Complex logic */
        int mysteryNumber = 42;
        boolean condition = ((mysteryNumber * 37) % 3 == 0);

        if (condition) {
            vector.add(5); // This won't affect the read point
        }

        vector.add(25); // Add unrelated element

        // More unrelated logic
        int dummy = vector.get(2) * 10;
        dummy += mysteryNumber;

        /* write */ if (mysteryNumber % 2 == 0) {
            vector.set(1, 99);  // This is the write affecting the read
        } else {
            vector.add(100); // Misleading write
        }

        vector.add(35); // Add another unrelated element

        // Irrelevant operation
        for (int i = 0; i < vector.size(); i++) {
            dummy += vector.get(i);
        }

        /* read */ int ret = vector.get(1);

        System.out.println("Retrieved value: " + ret);
    }
